import React from 'react';
import { Image, Grid, Header, Icon, Container, Divider } from 'semantic-ui-react';
import mountains from '../static/Mountains.jpg';
import '../App.css';


class About extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      container: ''
    };
  };

  render() {
    return(
        <div>
	        <Grid.Row>
	        <Image src = {mountains} size = 'large' centered bordered circular/>
	        <Divider hidden/>
	        </Grid.Row>
	        <Grid.Row>
	          <Container text textAlign = 'center'>
	          <p className = 'textblock' style={{'fontFamily': 'fantasy', 'fontSize': '150%'}}>
	            The Nepalese Students Association is a social 
	            and cultural organization that was established 
	            to unite patriots who are of Nepali origin or 
	            have interest in Nepalese culture. 
	            The main purpose of NSA is to promote 
	            and raise awareness about Nepalese language, 
	            literature, cultural and arts through various 
	            activities.
	          </p>
	          </Container>
	        </Grid.Row>
	        <Divider hidden/>
	        <Grid.Row>
	        <div>
	          <Header as='h2' icon textAlign='center'>
	            <Icon circular inverted name='american sign language interpreting' />
	            <Header.Content>NAMASTE!!</Header.Content>
	          </Header>
	        </div>
	        </Grid.Row>
      </div>
  )};
};

export default About;
